// import { NavLink } from 'react-router-dom';
import classes from './Footer.module.css';

export default function Footer() {
    return (
      <footer className={classes.footer__container}>
        <div>
          <img src={''} alt="logo" />
        </div>
        <div></div>
        <div></div>
        <div></div>
      </footer>
    );
  }
